					className='input'
				  type='password'
					placeholder='Username'
					value={username}
					onChange={(e)=>setUsername(e.target.value)}
					onFocus={()=>setUsernameFocus(true)}
					onBlur={()=>setUsernameFocus(false)}
					aria-invalid = {validUsername}
					aria-describedby='username-note'
					ref={usernameRef}
				/>
				<input 
					className='input'
				  type='text'
					placeholder='Username'
					value={username}
					onChange={(e)=>setUsername(e.target.value)}
					onFocus={()=>setUsernameFocus(true)}
					onBlur={()=>setUsernameFocus(false)}
					aria-invalid = {validUsername}
					aria-describedby='username-note'
					ref={usernameRef}
				/>
			</form>

		</div>
	)
}

export default Register
